// src/components/Home.js
import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div style={styles.container}>
      <h1>Welcome to the Home Page</h1>
      <p>
        This is the home page of your application. You can navigate to different sections using the links below.
      </p>
      <nav style={styles.nav}>
        <Link to="/signup" style={styles.link}>Sign Up</Link>
        <Link to="/dashboard" style={styles.link}>Dashboard</Link>
      </nav>
    </div>
  );
};

const styles = {
  container: {
    textAlign: 'center',
    padding: '50px',
  },
  nav: {
    marginTop: '20px',
  },
  link: {
    margin: '0 15px',
    textDecoration: 'none',
    color: 'blue',
  },
};

export default Home;
